    "title": "Himalayan turquoise bracelet on leather and tahitian pearl as clasp, black pearl of Tahiti, boho and beach jewelry, St Barth design.",
    "description": "Rare and Large turquoise stone from Himalaya \/ Tibet, use in traditional costume decoration mounted on my hand made precious leather with sailor knots and using a Tahitian pearl as clasp.\r\n \r\nThis ancient bead has burial patina, amazing colors, good high grade. I found this stone in a recent travel in india where i went up to Himalaya in Dharamsala. This one of a kind bracelet is using a semi-baroque 11.5 mm Tahitian pearl as clasp.\r\n\r\nPearl shape semi baroque \r\nLength 18.5 cm \r\nPearl grade C \r\nPearl quantity 1 \r\nPearl size  11.5 mm \r\nStyle bracelet \r\nMaterial Himalayan turquoise \/ Tahitian beads \/ leather \r\n\r\nPlease see below for more informations : \r\n\r\nTurquoise is a mineral colored blue by copper or green by iron. \r\nPraised since ancient times for its lustrous opaque qualities, it features in many Tibetan legends .The death mask of Tutankhamun was studded with Turquoise, as were the mosaic masks dedicated to the gods, the fabulous inlaid skulls, shields and power statues of Moctezuma, the last ruler of the Aztecs. \r\n\r\nIt owes its modern name to its arrival in Europe via Turkey; The Victorians loved it. \r\n\r\n For centuries Turquoise has been recognized as possessing the power to protect riders from injury due to falls. First used as amulets by Turkish soldiers, on their persons and attached to their bridles and trappings, it later came to be used for protection against falls of any kind. \r\n\r\nTurquoise is widely appreciated by Tibetans and all through Tibetan history has been prized, valued and worn as jewellery,not only for preserving the family wealth but also for its application in ritual and medicinal practice.\r\n\r\n &quot;Gyu&quot; (pronounced&quot;yu&quot;) the name for turquoise seems to be indigenous, indicating that knowledge of the mineral came from within and notthrough outside influences. To call a turquoise a stone will offend a Tibetan who will exclaim, &quot;this is a turquoise and not a stone!&quot;.\r\nWith the finest inherent colour in mind, perhaps it might help explain a couplet from a Tibetan love-song; &quot;I\u2019d guard her fragrant body, Like white turquoise so rare.&quot;\r\n\r\n*I Guarantee all my treasures genuine or a full refund. You will always be inform of the preparation as well as the shipment of your order.\r\n\r\n*All items are sent out in my hand made treasure gift box, carefully sealed including a personalized calligraphy for the unique opening pleasure of the beneficiary. \r\n\r\n*SHIPPING : due to my specific location (French West Indies Caribbean \/ St Barthelemy island), all my packages are send with registered mail including insurance and signature request. The reception delay is 3 to 8 days for France and 8 to 25 days for any other destinations.\r\n\r\n-DHL (optional) : if you want to receive your order safely in your hand in 3 to 4 business days, I use DHL international shipping with insurance for a participation fee of 35 Dollars, Thank you to advise me before placing your order for adjustment. (buyers are responsible for any and all duties and customs charges that may be incurred).",
