    "title": "Sapphires and silver cob coin drops, treasures of caribbean, rough sapphires, pirates, hippiechic, bohemian, boho, beach and leather jewelry",
    "description": "Unique pair of earrings made with rough sapphires (which i bought during a recent travel in Jaipur \/ India) and hand-shapped pieces of silver authentic pirates &quot;piece of eight &quot; dated around 1650&#39;s from an english private collection.Visible details remain, please recall that this coins have spend centuries at the bottom of the ocean.These treasures have been mounted  with care on my precious hand rolled leather in the island of St Barts on two silver clasp.\r\n\r\nMaterial Sapphires \/ piece of 8 \/ leather \/ silver clasps \r\nLength 9 cm \r\nStyle earrings \r\n\r\nPlease refer below for the full stone explanation :\r\n\r\n&quot;Cob coins&quot; are rare, difficult to find.\r\nSome of them are from private collections.\r\nSome others are bought at auction in archaeological foundations and other are the booty of passionate treasure seekers , which are walking miles and miles of beaches, armed with a metal detector and lots of patience... \r\n\r\nHISTORY : \r\n\r\nFor most people the word shipwreck represents old sunken Spanish galleons, dismasted and rudderless in hurricane seas, their panicked crews helpless and praying as the ships slam into reefs that rip open their fragile hulls and send chests of gold and silver to the bottom. Indeed many Spanish galleons returning to Europe from the Americas met this tragic fate. By some estimates a third of Spain\u2019s treasure ships never made it home. A lot of treasure is still waiting to be recovered.\r\n\r\nBetween 1492 and the early 19th century, Spain extracted billions and billions of dollars&#39; worth of gold, silver, precious gems and other treasures from the Caribbean, Mexican and South American colonies. Treasure and other trade goods were loaded at the new Spanish ports in Panama, Colombia, Ecuador, Mexico, Peru and the Philippines, then shipped to Spain in large armed fleets of galleons.\r\n\r\nThe Spanish colonial mints at Potos\u00ed, Lima, Cartagena, Bogot\u00e1 and Mexico City (plus a few others) labored day and night to produce the irregularly shaped gold and silver coins commonly referred to as macuquinas (crude hammered coins) or \u201ccobs.&quot; It is believed the word &quot;cob&quot; is the simplification of the Spanish phrase &quot;cabo de barra,&quot; meaning &quot;end of the bar,&quot; as the blanks, or planchets, for these coins were actually sliced off the ends of silver bars straight from the mines. The planchets were then trimmed to prescribed weights and struck between crude dies, thus no two cobs are ever exactly alike! That is what makes these &quot;macuquinas&quot; unique and really interesting to collect.\r\n\r\nWhen you talk about &quot;treasure coins,&quot; though, keep in mind that underweight silver coins are very common due to corrosion from salt water and erosion from 300-400 years at the bottom of the sea. \r\n\r\nCobs were minted from the early 1500\u2019s until the mid-18th century.\r\n\r\nBy a royal statute first promulgated in the reign of Charles I of Spain, the official weights of the silver reales were as follows:\r\n\r\n\u00b7 8 reales (cob) = 27.3 grams [0.96 ounces]\r\n\u00b7 4 reales (cob) = 13.65 grams [0.48 ounces]\r\n\u00b7 2 reales (cob) = 6.825 grams [0.24 ounces] \r\n\r\n*I Guarantee all my treasures genuine or a full refund. You will always be inform of the preparation as well as the shipment of your order.\r\n\r\n*All items are sent out in my hand made treasure gift box, carefully sealed including a personalized calligraphy for the unique opening pleasure of the beneficiary. \r\n\r\n*SHIPPING : due to my specific location (French West Indies Caribbean \/ St Barthelemy island), all my packages are send with registered mail including insurance and signature request. The reception delay is 3 to 8 days for France and 8 to 25 days for any other destinations.\r\n\r\n-DHL (optional) : if you want to receive your order safely in your hand in 3 to 4 business days, I use DHL international shipping with insurance for a participation fee of 35 Dollars, Thank you to advise me before placing your order for adjustment. (buyers are responsible for any and all duties and customs charges that may be incurred).\r\n\r\n.",
